scriptlet.script:
try{
	switchFromFixedProduct = switchFromFixedProduct;
	switchFromFlexiProduct = switchFromFlexiProduct;
	switchFromRocketProduct = switchFromRocketProduct;
	switchProduct = switchProduct;

	var fromFilter;
	if(switchFromFixedProduct == 'Y' && switchProduct =='Y')
	{
	fromFilter = 'Fixed Rate';
	scriptletContext.put("fromFilter", fromFilter);
	response = "success";
	} 
	else if(switchFromFlexiProduct == 'Y' && switchProduct =='Y')
	{
	fromFilter = 'Flexi First';
	scriptletContext.put("fromFilter", fromFilter);
	response = "success";
	}
	else if(switchFromRocketProduct == 'Y' && switchProduct =='Y')
	{
	fromFilter = 'Rocket';
	scriptletContext.put("fromFilter", fromFilter);
	response = "success";
	}
	else
	{
	fromFilter = '-';
	scriptletContext.put("fromFilter", fromFilter);
	response = "success";
	}

} catch(err) {
		scriptletContext.put("errorMessage",err.message);	
		response = "failure";
	}
	scriptletResponse = response

try{
